Но, игру ОБОБРЯЕМ!!!!!!!!!!!!!!!

кратко об игре : 
1 стадия – Отрицание (человек отказывается принимать то, что с ним случилось);
2 стадия – Гнев (на этом этапе проявляется агрессия ко всему окружающему миру);
3 стадия – Торг (появляются мысли о том, чтобы договориться о более лучшей участи);
4 стадия – Депрессия (на данном этапе человек может круглые сутки находится в депрессивном состоянии);
5 стадия – Принятие (согласие с неизбежной участью).

항아리게임같이 조작감 개구린겜인줄 알았으나 나름 준수한 조작감이라 좀놀랬음
게임이 파쿠르도있어서 겁나쉬워보이네~ 하면서 시작했다가 큰코다침;
오랜만에 인내심테스트게임하면서 재밌게즐긴듯 추천추천

Что мы получаем за 500 рублей?
- Текстуры прямиком из двухтысячных;
- Регулярные проваливания под текстуры и застревания;
- Всратую оптимизацию;
- Раздражающую музыку, которую нельзя отключить в игре, а только через микшер;
- Риск остаться без монитора, когда во время спринта персонаж зацепится за мизерный выступ на трубе, ступеньку, еще какое-нибудь "препятствие" или невидимую текстуру и улетит так, будто его сбило гоночным автомобилем;
- Лотерею, вскарабкается ли персонаж или отлетит от стены как от батута.

Если за каждый минус отнять по 100 рублей, то разработчик еще и должен остается.
Думайте...

Оформляю уверенный возврат. Может обращу еще раз свое внимание, если приведут в приемлемый для продажи вид.
